import React from "react";
import "./App.css";
import Login from "./components/login.jsx";

function App() {
  return (
    <div
      className="container-fluid"
      style={{
        display: "flex",
        height: "100vh"
      }}
    >
      <div
        className="row justify-content-center"
        style={{ height: "100%", background: "red" }}
      >
        <div className="col-12">
          <Login />
        </div>
      </div>
    </div>
  );
}

export default App;
